import React from 'react'

import Formate from './Formate'

const DataList = ({title, formate}) => {
  return (
    <div>
        
        <table>
            <thead>
                {title.map((item, index) => {
return (

    <th
    style={{ whiteSpace: "nowrap", textAlign: "center", fontSize:"12.5px" }}
    key={index}>{item}</th>
)
                })}
            </thead>
            <tbody>
                <Formate/>
            </tbody>
        </table>
    </div>
  )
}

export default DataList
